import React from "react";

const ContactCard = ({ contact }) => {
  const { firstname, lastname, email, profession, gender, bio, url } = contact;
  return (
    <div>
      <div class=" dark:bg-gray-900 flex flex-wrap items-center justify-center ">
        <div class=" p-4 bg-white rounded dark:bg-gray-800 shadow-xl transform duration-200 easy-in-out m-2">
          <div class=" ">
            <div class="h-40 w-32 rounded-lg">
              <img alt={firstname} src={url} />
            </div>
          </div>

          <div class="ml-4">
            <h2 class="text-xl font-bold text-green-800 dark:text-gray-300">
              {firstname + " " + lastname}
            </h2>
            <p class="text-gray-400  dark:text-gray-400">{profession}</p>
            <div className="text-sm">{email}</div>
            <p class=" text-gray-600 dark:text-gray-300">{bio}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactCard;
